#include <iostream>
#include <queue>
#include <string>

#include "utility.hpp"
using namespace std;

int main() {
    string s = "";
    int count[26] = {0}, runLength = 14;
    for (int i = 0; i < s.length(); i++) {
        count[s[i] - 'a']++;
        if (i > runLength - 1) count[s[i - runLength] - 'a']--;

        if (i >= runLength - 1) {
            bool valid = true;
            for (int val : count) {
                if (val > 1) {
                    valid = false;
                    break;
                }
            }

            if (valid) {
                cout << i + 1 << endl;
                break;
            }
        }
    }
}